import React from 'react';
import Home from './Home';
import GlobalStyles from './GlobalStyles';
import { ThemeProvider } from 'styled-components';

function App() {
  return (
    <>
      <ThemeProvider theme={{ color: '#ffffff', bgColor: '#202020' }}>
        <GlobalStyles />
        <Home />
      </ThemeProvider>
    </>
  );
}

export default App;
